import React from 'react'
const Home = () => {
  return (
    <div className="container">

    <h1 className="text-center" style={{paddingTop: "30%"}}>
     Exceeding Expectations, One Patient at a Time
    </h1>
    &nbsp;
    &nbsp;
    &nbsp;
    &nbsp;
    &nbsp;
    &nbsp;

    <p>Chandarprabha hospital was established 20 years back with its aim to understand and empathize with the suffering of people. The primary ideology behind its establishment was to serve people and their needs in the best of their interest. Our establishment cordially and warmly welcomes all people who deserve to seek integrated medical health care support and treatment. 



It has been years of commitment and excellent performance in the field of medicine, surgery, neuropsychiatric, and obstetrics & gynecological departments.



Dr. K.K. Pandey the founder of our institution, has a noble vision to offer and serve the best, convenient, proper, and affordable medical facilities to people dealing with health and financial crisis. we appreciate your support, love, and feedback.



Wish you all health, a prosperous and long life!</p>

  </div>
  )
}
export default Home;
